package tabuada;

public class Tabuada{
	public int x;
	public int y;
	public int mult;
	public int res;
	
	

	public Tabuada(int x, int y, int mult , int res) {
		super();
		this.x = x;
		this.y = y;
		this.mult = mult;
		this.res = res;
	}
	

	public Tabuada() {
		super();
		// TODO Auto-generated constructor stub
	}


	public int getX() {
		return x;
	}


	public void setX(int x) {
		this.x = x;
	}


	public int getY() {
		return y;
	}


	public void setY(int y) {
		this.y = y;
	}


	public int getMult() {
		return mult;
	}


	public void setMult(int mult) {
		this.mult = mult;
	}

	public int getRes() {
		return res;
	}


	public void setRes(int res) {
		this.res = res;
	}

	

}